  false,\n\t\"url\": null,\n\t\"notes\": \"Shorelines were derived from the U.S. Geological
  Survey Earth Resources Observation and Science (EROS) Centeru2019s Digital Orthophoto
  Quadrangle (DOQ) images collected on November 17, 2005. This dataset contains digitized
  shorelines created from the USGS imagery for Breton Island, Louisiana. Shorelines
  were digitized in ArcMap 10.2.2 so they could be used for area and shoreline change
  analysis, using the Digital Shoreline Analysis System (DSAS) version 4.0.\",\n\t\"license_title\":
